import { useEffect, useState } from 'react';
import './Pomodoro.css';

const Pomodoro = () => {

    const [counter, setCounter] = useState(0);

    useEffect(() => {
        const interval = setInterval(() => {
            setCounter(counter += 1)
        })
    })

    return (
        <div>
            <h2 className='header'>PomoFocus</h2>
            <p>{counter}</p>
        </div>
    )
}

export default Pomodoro;
